import React from 'react';
import { Card, ListGroup, Form } from "react-bootstrap"; // Import ListGroup and Form
import Rating from './Rating';
import { Link } from 'react-router-dom';

function Mylistsscreen({ product }) {
  return (
    <Card className='my-3 p-3 rounded'>

      <Link to={`/movies/${product.id}/`} >

        <Card.Img src={product.image_url} />
      </Link>

      <Card.Body>
        <Link to={`/movies/${product.id}/`} className='text-dark'>
          <Card.Title as="h3">
            <Link to={`/movies/${product.id}/`} className='text-dark'>
              {product.title}
            </Link>
          </Card.Title>
        </Link>
        <ListGroup variant="flush">
          <ListGroup.Item>
            <Form.Check
              type="checkbox"
              label="Add to My List"
              onChange={() => console.log('Checkbox changed')} />
          </ListGroup.Item>
        </ListGroup>
      </Card.Body>
    </Card>
  );
}

export default Mylistsscreen;
